window.bookSummaryJSON = "<p><b>Juliette and Warner’s story continues in the thrilling fifth installment of Tahereh Mafi’s </b><b><i>New York Times </i></b><b>bestselling Shatter Me series.</b></p> <p>Juliette Ferrars isn’t who she thinks she is.</p> <p>Nothing in her world is what it seemed. She thought she’d finally defeated the Reestablishment. She thought she’d finally taken control of her life, her power, and her pain. But Juliette has only just begun to unravel a lifetime of lies, and she finds herself faced with a familiar choice:</p> <p>Be a weapon. Or be a warrior.</p> <p>This time, she’s not alone. Stronger, braver, and more resilient than ever, Juliette will fight for life and love with her friends by her side—but first, she has to survive the war being waged against her mind:</p> <p>She has to remember who she was.</p> <p>Narrated by Juliette, Warner, and Kenji Kishimoto, this gripping novel perfectly sets the stage for the highly anticipated forthcoming conclusion to the Shatter Me series.</p>"; 
